import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";

import SupplyList from "../components/Suppliers/SupplyList";

const Suppliers = () => {
  const SUPPLIERS = [
    {
      id: "s1",
      name: "Giang Garment Factory",
      imageUrl:
        "https://a.c-dn.net/b/4uot3B/headline_shutterstock_243762007.jpg",
      address: "8 Sixth Lok Yang Rd, Singapore 628106",
      mobile: 68621169,
      open_hour: 9,
      close_hour: 18,
      location: {
        lat: 1.3265611,
        lng: 103.6823505,
      },
    },
    {
      id: "s3",
      name: "DBrandt Oilfield Services",
      imageUrl:
        "https://a.c-dn.net/b/4uot3B/headline_shutterstock_243762007.jpg",
      address: "8 Sixth Lok Yang Rd, Singapore 628106",
      mobile: 68621169,
      open_hour: 9,
      close_hour: 18,
      location: {
        lat: 1.3265611,
        lng: 103.6823505,
      },
    },
    {
      id: "s2",
      name: "DBrandt Oilfield Services",
      imageUrl:
        "https://a.c-dn.net/b/4uot3B/headline_shutterstock_243762007.jpg",
      address: "8 Sixth Lok Yang Rd, Singapore 628106",
      mobile: 68621169,
      open_hour: 9,
      close_hour: 18,
      location: {
        lat: 1.3265611,
        lng: 103.6823505,
      },
    },
    {
      id: "s4",
      name: "DBrandt Oilfield Services",
      imageUrl:
        "https://a.c-dn.net/b/4uot3B/headline_shutterstock_243762007.jpg",
      address: "8 Sixth Lok Yang Rd, Singapore 628106",
      mobile: 68621169,
      open_hour: 9,
      close_hour: 18,
      location: {
        lat: 1.3265611,
        lng: 103.6823505,
      },
    },
  ];
  return <SupplyList items={SUPPLIERS} />;
};

export default Suppliers;
